  case X86_Bit_64:
    if ((rInsn.GetPrefix() & X86_Prefix_REX_w) == X86_Prefix_REX_w)
      return Expr::MakeMem(64, Decode_DS(rBinStrm, Offset, rInsn, Mode), Decode_d64_rSI(rBinStrm, Offset, rInsn, Mode), true);
